import React, { useState } from 'react';
import { Bell, Clock, MapPin, X, CheckCircle2, Calendar, RefreshCw, MessageSquare } from 'lucide-react';

const Dashboard = ({ user, events, theme, regCount }) => {
  const isDark = theme === 'dark';
  const [isNotiOpen, setIsNotiOpen] = useState(false);

  // Notifications updated to match your latest screenshot design
  const notifications = [
    { id: 1, title: "Registration approved", desc: "Your account has been verified. You can now access all features.", time: "2h ago", icon: <CheckCircle2 size={18} /> },
    { id: 2, title: "New event added", desc: "Summer Workshop has been added to your calendar.", time: "Yesterday", icon: <Calendar size={18} /> },
    { id: 3, title: "Event updated", desc: "The location for Team Lunch has been changed to Main hall.", time: "Yesterday", icon: <RefreshCw size={18} /> },
    { id: 4, title: "New comment", desc: "Sarah replied to your post regarding the design updates.", time: "2d ago", icon: <MessageSquare size={18} /> }
  ];

  const styles = {
    // Main App Container (Centered and fixed width)
    container: { 
      maxWidth: '400px', 
      margin: '0 auto', 
      padding: '16px', 
      paddingBottom: '100px', 
      position: 'relative', 
      minHeight: '100vh',
      backgroundColor: isDark ? '#0f172a' : '#fff',
    },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '24px' },
    
    // --- NOTIFICATION SLIDE (Matched to Dashboard Size) ---
    notiOverlay: {
      position: 'fixed',
      top: 0, left: 0, right: 0, bottom: 0,
      backgroundColor: 'rgba(0,0,0,0.4)',
      display: isNotiOpen ? 'block' : 'none',
      zIndex: 100,
    },
    notiPanel: {
      position: 'fixed',
      bottom: 0, 
      left: '50%', // Centers horizontally
      transform: isNotiOpen ? 'translateX(-50%) translateY(0)' : 'translateX(-50%) translateY(100%)',
      width: '100%',
      maxWidth: '400px', // MATCHES DASHBOARD WIDTH
      backgroundColor: isDark ? '#1e293b' : '#fff',
      borderTopLeftRadius: '28px',
      borderTopRightRadius: '28px',
      padding: '24px 20px',
      transition: 'transform 0.4s cubic-bezier(0.4, 0, 0.2, 1)',
      zIndex: 101,
      maxHeight: '85vh',
      boxShadow: '0 -10px 25px rgba(0,0,0,0.1)',
      overflowY: 'auto'
    },
    // Notification Card Styling
    notiCard: {
      display: 'flex',
      gap: '12px',
      padding: '16px',
      backgroundColor: isDark ? '#0f172a' : '#fff',
      borderRadius: '16px',
      marginBottom: '12px',
      border: isDark ? '1px solid #334155' : '1px solid #f1f5f9',
      boxShadow: '0 2px 8px rgba(0,0,0,0.02)'
    }
  };

  return (
    <div style={styles.container}>
      
      {/* NOTIFICATION SLIDE */}
      <div style={styles.notiOverlay} onClick={() => setIsNotiOpen(false)} />
      <div style={styles.notiPanel}>
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
          <div style={{ display: 'flex', alignItems: 'center', gap: '12px' }}>
            <X size={24} onClick={() => setIsNotiOpen(false)} style={{ cursor: 'pointer' }} />
            <h2 style={{ fontSize: '20px', fontWeight: 'bold' }}>Notifications</h2>
          </div>
        </div>

        {notifications.map(item => (
          <div key={item.id} style={styles.notiCard}>
            <div style={{ 
              width: '40px', height: '40px', borderRadius: '12px', 
              backgroundColor: '#eff6ff', color: '#2563eb', 
              display: 'flex', justifyContent: 'center', alignItems: 'center', flexShrink: 0 
            }}>
              {item.icon}
            </div>
            <div style={{ flex: 1 }}>
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'start' }}>
                <p style={{ margin: 0, fontWeight: 'bold', fontSize: '14px', color: '#2563eb' }}>{item.title}</p>
                <span style={{ fontSize: '11px', color: '#94a3b8' }}>{item.time}</span>
              </div>
              <p style={{ margin: '4px 0 0 0', fontSize: '13px', color: '#64748b', lineHeight: '1.4' }}>{item.desc}</p>
            </div>
          </div>
        ))}
      </div>

      {/* DASHBOARD HEADER */}
      <header style={styles.header}>
        <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
          <div style={{ width: '36px', height: '36px', borderRadius: '50%', backgroundColor: '#2563eb', color: '#fff', display: 'flex', justifyContent: 'center', alignItems: 'center', fontWeight: 'bold' }}>ES</div>
          <span style={{ fontWeight: 'bold' }}>EventSphere</span>
        </div>
        <Bell size={22} onClick={() => setIsNotiOpen(true)} style={{ cursor: 'pointer' }} />
      </header>

      <h1 style={{ fontSize: '28px', fontWeight: 'bold' }}>Hi {user.name.split(' ')[0]} ðŸ‘‹</h1>
      <p style={{ color: '#64748b', fontSize: '14px', marginBottom: '24px' }}>Explore college events</p>

      {/* REMAINDER OF YOUR DASHBOARD CODE (Stats, Event Cards, etc.) */}
      {/* ... */}
    </div>
  );
};

export default Dashboard;
